<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 kringle - 2 induces death of mesencephalic dopaminergic neurons in vivo and in vitro via microglial activation . We have shown that prothrombin kringle - 2 ( pKr - 2 ) , a domain of human prothrombin distinct from thrombin could activate cultured rat brain microglia in vitro . However , little is known whether pKr - 2 - induced microglial activation could cause neurotoxicity on dopaminergic ( DA ) neurons in vivo . To address this question , pKr - 2 was injected into the rat substantia nigra ( SN ) . Tyrosine hydroxylase ( TH ) immunohistochemistry experiments demonstrate significant loss of DA neurons seven days after injection of pKr - 2 . In parallel , pKr - 2 - activated microglia were detected in the SN with OX - 42 and OX - 6 immunohistochemistry . Reverse transcription PCR and double-label immunohistochemistry revealed that activated microglia in vivo exhibit early and transient expression of inducible nitric oxide synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35228

</mark>
 ) , cyclooxygenase - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and several proinflammatory cytokines . The pKr - 2 - induced loss of SN DA neurons was partially inhibited by the NOS inhibitor N ( G ) - nitro-L-arginine methyl ester hydrochloride , and the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor DuP - 697 . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 / 2 , c-Jun N-terminal kinase and p38 mitogen-activated protein kinase were activated in the SN as early as 1 hr after pKr - 2 injection , and localized within microglia . Inhibition of these kinases led to attenuation of mRNA expression of

 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and several proinflammatory cytokines , and rescue of DA neurons in the SN . Intriguingly , following treatment with pKr - 2 in vitro , neurotoxicity was detected exclusively in co-cultures of mesencephalic neurons and microglia , but not microglia-free neuron-enriched mesencephalic cultures , indicating that microglia are required for pKr - 2 neurotoxicity . Our results strongly suggest that microglia activated by endogenous compound ( s ) , such as pKr - 2 , are implicated in the DA neuronal cell death in the SN .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Heart allograft protection with low-dose carbon monoxide inhalation : effects on inflammatory mediators and alloreactive T-cell responses . BACKGROUND : DB11588 ( CO ) , a byproduct of heme catalysis , has lately received considerable attention as a regulatory molecule in cellular and biological processes . CO has been shown to provide potent protection against a variety of tissue injuries . We hypothesized in this study that low concentration CO would be beneficial for organ allografts , which frequently undergo several types of injury such as ischemia / reperfusion , alloimmune reaction , and inflammation METHODS : The efficacy of low-dose CO was examined in a fully allogeneic LEW to BN rat heterotopic heart transplantation ( HHTx ) model . Recipients were kept in air or exposed to low-dose CO ( 20 ppm ) for 14 , 28 , or 100 days after HHTx under short-course tacrolimus RESULTS : CO treatment ( d0 - 28 , 0-100 ) was remarkably effective in prolonging heart allograft survival to a median of &gt; 100 from 45 days in the air-control group , with significant reductions of arteritis , fibrosis , and cellular infiltration , including macrophages and T cells . CO inhibited intragraft upregulation of Th1 type cytokines (

<div class="entities" style="line-height: 2.5; direction: ltr">Effects of external calcium on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . DB01373 is a known signalling molecule in eukaryotic cells and plays a central role in the regulation of many cellular processes . In the following study , we report on the effect of external calcium treatments on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . We observed that the intracellular calcium content of P . bainier 229-7 mycelia was increased in response to exposure to high external Ca ( 2 + ) concentrations . Both ginsenoside Rd biotransformation and -glucosidase activity were both found to be dependent on the external calcium concentration . At an optimal Ca ( 2 + ) concentration of 45 mM , maximal ginsenoside Rd bioconversion rate of 92.44 % was observed and maximal -glucosidase activity of 0.1778 U was reached in a 72 - h biotransformation . The Ca ( 2 + ) channel blocker Verapamil blocked the trans-membrane influx of calcium and decreased ginsenoside Rd biotransformatiom . In addition , -glucosidase activity and ginsenoside Rd content decreased by 36.0 and 29.2 % respectively after a 72 - h incubation in the presence of 0.05 mM P62158 ( P62158 ) antagonist 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . These results suggest that both Ca ( 2 + ) channels and P62158 are involved in ginsenoside Rd biotransformation via regulation of -glucosidase activity . This is the first report regarding the effects of calcium signal transduction on biotransformation and enzyme activity in fungi .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Interpretation of point-of-care INR results in patients treated with dabigatran . BACKGROUND : Point-of-care devices for measurement of the international normalized ratio ( INR ) are commonly used to monitor therapy and maintain therapeutic levels of anticoagulation in patients treated with vitamin K antagonists .

 time and INR levels were increased about 2 - to 4 - fold with the point-of-care device compared with laboratory measures across the plasma dabigatran concentration range 50-1400 ng / mL . At plasma concentrations of dabigatran likely to be observed in patients , at a dose of 150 mg twice daily ( 60-275 ng / mL ) , whole blood point-of-care INR values increased from 1.7 to 4.0 , versus 1.1 to 1.5 measured with the laboratory coagulometer . Similar differences in prothrombin time were observed in plasma samples . CONCLUSIONS : INR levels in patients taking dabigatran are substantially higher using a Hemochron Jr . point-of-care device compared with laboratory values . We discourage the use of these devices specifically , as well as the use of the INR in general , for measuring the anticoagulant effect of dabigatran .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">The analgesic efficacy of valdecoxib vs . oxycodone / acetaminophen after oral surgery . BACKGROUND : The authors conducted two studies to compare the analgesic efficacy and safety of the cyclooxygenase , or

<div class="entities" style="line-height: 2.5; direction: ltr">P62158 - mediated effects of loperamide on chloride transport by brush border membrane vesicles from human ileum . We investigated whether the synthetic opiate loperamide-HCl is able to regulate specific transport systems for sodium and chloride in brush border membrane vesicles ( BBMVs ) from human ileum and whether such activities are mediated by calcium / calmodulin . In BBMVs we studied Na + / H + antiport , Cl + / OH - antiport , Na + / Cl - cotransport , and the Cl - conductive pathway . Brush border membrane vesicles were incubated with 10 microM loperamide over 4 h at 5 degrees C before the uptake experiments . In ileal BBMVs , loperamide stimulated intravesicular accumulation of Na + in the presence of Cl - and vice versa . After 1 min of incubation , the stimulatory effect was 35 % + / - 5 % ( p less than 0.005 ) of the control without loperamide .

 also stimulated Cl - / OH - antiport by 30 % + / - 5 % ( p less than 0.005 ) in BBMVs of ileum . In addition , we studied the role of Ca2 + / calmodulin in the action of loperamide on chloride transport by human BBMVs . In loperamide-pretreated BBMVs , calmodulin activity was significantly decreased ( 12 + / - 2 vs . 38 + / - 4 pmol / mg protein ) . When loperamide-pretreated vesicles were incubated with 2 microM calcium ( free concentration ) plus 5 microM calmodulin for 1 h at 5 degrees C , complete inhibition of the stimulatory effect of loperamide on Cl - / OH - antiport and Na + / Cl - cotransport was observed . Increasing the Ca2 + / calmodulin activity of loperamide-pretreated BBMVs with 2 microM calcium plus 5 microM calmodulin led to a significant inhibition of Cl - / OH - antiport and Na + / Cl - cotransport by 40 % + / - 5 % ( p less than 0.005 ) .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Anti-inflammatory activity of Taraxacum officinale . Taraxacum officinale has been widely used as a folkloric medicine for the treatment of diverse diseases . The dried plant was extracted with 70 % ethanol to generate its ethanol extract ( TEE ) . For some experiments , ethyl acetate ( EA ) , n-butanol ( BuOH ) and aqueous ( Aq ) fractions were prepared in succession from TEE . TEE showed a scavenging activity in the 1,1- diphenyl - 2 - picrylhydrazyl ( DPPH ) assay , a diminishing effect on intracellular reactive oxygen species ( ROS ) level , and an anti-angiogenic activity in the chicken chorioallantoic ( P62158 ) assay . In the carrageenan-induced air pouch model , TEE inhibited production of exudate , and significantly diminished nitric oxide ( NO ) and leukocyte levels in the exudate . It also possessed an inhibitory effect on acetic acid-induced vascular permeability and caused a dose-dependent inhibition on acetic acid-induced abdominal writhing in mice . Suppressive effects of TEE on the production of NO and expression of inducible nitric oxide synthase (

 ) and cyclooxygenase - 2 (
